                closeIcon={<IoIosClose />}
                visible={true}
                style={{
                    backgroundColor: 'white',
                    position: 'relative',
                    width: 300,
                    margin: '0 auto',
                    outline: 'none',
                    top: -150,
                    padding: 12,
                    boxShadow: '0 3px 6px -4px rgba(0, 0, 0, 0.12), 0 6px 16px 0 rgba(0, 0, 0, 0.08), 0 9px 28px 8px rgba(0, 0, 0, 0.05)',
                    borderRadius: 4,
                }}
                maskStyle={{
                    backgroundColor: 'rgba(255,255,255,0.8)',
                    position: 'absolute',
                    width: '100%',
                    height: '100%',
                    top: 0
                }}
                title='tt'
            >
                aa
            </Dialog>
        </div>
    )
}
